import './main.css';

import { PHButton } from "@src/ui/common/element/muButton";

const ToolMain = (props) => {
  return <section className='toolMain' {...props}>
    <header>
      <h1>도구들</h1>
      <p>내가 <del>가지고 놀려고</del> 쓰려고 만든 도구들</p>
    </header>
    <aside>
      <h3>프로토콜 분석기</h3>
      <p>
        학부 과제용으로 만들었던,
      </p>
      <p>
        <PHButton variant='success'>이동 ↗</PHButton>
      </p>
    </aside>
  </section>;
}

export { ToolMain };
